  [],\n\t\"revision_timestamp\": \"2015-12-20T18:34:18.969759\",\n\t\"name\": \"rarotonga-sr-ca-and-sst-reconstruction-data-for-1726-to-1997\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A 271 year record of Sr/Ca variability
  in a coral from Rarotonga in the South Pacific gyre. Calibration with monthly sea
  surface temperature (SST) from satellite and ship measurements made in grid measuring
  1 deg by 1 deg over the period from 1981 to 1997 indicates that this Sr/Ca record
  is an excellent proxy for SST. Comparison with SST from ship measurements made since
  1950 in a grid measuring 5 deg by 5 deg also shows that the Sr/Ca data accurately
  record decadal changes in SST. The entire Sr/Ca record back to 1726 shows a distinct
  pattern of decadal variability with repeated decadal and interdecadal SST regime
  shifts greater than 0.75 deg C. Comparison with decadal climate variability in the
  North Pacific as represented by the Pacific Decadal Oscillation index (1900-1997)
  indicates that several of the largest decadal-scale SST variations at Rarotonga
  are coherent with SST regime shifts in the North Pacific. This hemispheric symmetry
  suggests that tropical forcing may be an important factor in at least some of the
  decadal variability observed in the Pacific Ocean.\",\n\t\"license_title\": null,\n\t\"extras\":
